CREATE DEFINER=`root`@`localhost` PROCEDURE `Medicao[UPDATE]` (IN `id` INT, IN `valorM` VARCHAR(10), IN `variavelM` VARCHAR(10), IN `dhora` VARCHAR(30))  NO SQL
BEGIN
DECLARE uid int;
DECLARE auxvalorM int;
DECLARE auxvariavel int;
DECLARE auxdhora datetime;
SET @uid = (SELECT investigador.Id_Investigador FROM investigador WHERE investigador.Email_Investigador = USER());

IF valorM = '' THEN
SET @auxvalorM = (SELECT medicao.Valor_Medicao FROM medicao WHERE medicao.Id_Medicao = id);
ELSE SET @auxvalorM = (SELECT CAST(valorM AS int));
END IF;

IF variavelM = '' THEN
SET @auxvariavel = (SELECT medicao.Variavel_medida_fk FROM medicao WHERE medicao.Id_Medicao = id);
ELSEIF (SELECT EXISTS(SELECT variavel_medida.Variavel_medida_ID FROM variavel_medida, cultura WHERE variavel_medida.cultura_fk = cultura.Id_Cultura AND cultura.investigador_fk = @uid AND variavel_medida.Variavel_medida_ID = (SELECT CAST(variavelM AS int)))= 0) THEN
SET @auxvariavel = (SELECT medicao.Variavel_medida_fk FROM medicao WHERE medicao.Id_Medicao = id);
ELSE SET @auxvariavel = (SELECT variavel_medida.Variavel_medida_ID FROM variavel_medida, cultura WHERE variavel_medida.cultura_fk = cultura.Id_Cultura AND cultura.investigador_fk = @uid AND variavel_medida.Variavel_medida_ID = (SELECT CAST(variavelM AS int)));
END IF;

IF dhora = '' THEN
SET @auxdhora = (SELECT medicao.Data_Hora_Medicao FROM medicao WHERE medicao.Id_Medicao = id);
ELSE SET @auxdhora = (SELECT CAST(dhora AS datetime));
END IF;

UPDATE medicao, variavel_medida, cultura
SET medicao.Data_Hora_Medicao = @auxdhora, medicao.Valor_Medicao = @auxvalorM, medicao.Variavel_medida_fk = @auxvariavel WHERE medicao.Id_Medicao = id AND medicao.Variavel_medida_fk = variavel_medida.Variavel_medida_ID AND variavel_medida.cultura_fk = cultura.Id_Cultura AND cultura.investigador_fk = @uid;                
END$$

